  const open = () => {
    console.log('window opened');
  }

  const windowStyle = {
    backgroundColor: '#060B15',
    padding:"30px",
    paddingTop: "0",
    marginBottom: "5%",
    border: "1px solid white",
    borderRadius: "1%"
  };

  return (
    <div onClick={open} style={windowStyle}>
        <div>
            <p>x</p>
